"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Aortic coarctation in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/aortic-coarctation-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H15992583\">",
"      <span class=\"h1\">",
"       What is aortic coarctation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Aortic coarctation",
"      <strong>",
"      </strong>",
"      is a heart defect that causes the heart&rsquo;s largest vessel, called the &ldquo;aorta&rdquo;, to narrow (",
"      <a class=\"graphic graphic_figure graphicRef65713 \" href=\"mobipreview.htm?24/38/25187\">",
"       figure 1",
"      </a>",
"      ). People with this condition are born with it. But they might not find out that they have the condition until they are adults. People with aortic coarctation often also have a heart valve problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992598\">",
"      <span class=\"h1\">",
"       What are the symptoms of aortic coarctation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with aortic coarctation do not have any symptoms. But often they have high blood pressure. If their high blood pressure is not treated, symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Trouble breathing, especially when exercising",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Leg cramps",
"       </li>",
"       <li>",
"        Fatigue",
"       </li>",
"       <li>",
"        Nosebleeds",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People with aortic coarctation usually have high blood pressure in their arms (especially the right arm) but low blood pressure in their legs. Also, their pulse is much weaker in the groin area than in the neck or arms.",
"     </p>",
"     <p>",
"      A less common but serious problem that can happen in people with aortic coarctation is a bleed inside the head due to an enlarged blood vessel.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992613\">",
"      <span class=\"h1\">",
"       Are there tests for aortic coarctation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor will do an exam and measure your pulse and blood pressure in your arms and legs. Other tests include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An electrocardiogram &ndash; This test measures the electrical activity of the heart. It is also called an &ldquo;ECG&rdquo; or &ldquo;EKG.&rdquo;",
"       </li>",
"       <li>",
"        An echocardiogram &ndash; This test uses sound waves to take pictures of your heart and aorta.",
"       </li>",
"       <li>",
"        An MRI or CT scan &ndash; These tests can take pictures of your aorta as well as the blood vessels in the head.",
"       </li>",
"       <li>",
"        A cardiac catheterization - During this test, the doctor inserts a thin tube into a blood vessel in your leg or arm and advances the tube to your aorta. Then the doctor injects a dye that shows up on an X-ray. This dye can show how much your aorta has narrowed.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992628\">",
"      <span class=\"h1\">",
"       How is aortic coarctation treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The type of treatment you have depends how much your aorta has narrowed, your symptoms, and your age. Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Angioplasty&nbsp;&ndash; A doctor puts a thin tube into a blood vessel in the leg or arm and advances the tube to the aorta. Then the doctor inflates a balloon inside the aorta to widen it. In some cases, the doctor props open the aorta using a mesh tube called a &ldquo;stent.&rdquo;",
"       </li>",
"       <li>",
"        Surgery&nbsp;&ndash; Different types of surgery can fix the narrowed aorta. The surgeon might remove the narrowed part of the aorta. In some cases, he or she uses a plastic tube called a &ldquo;graft&rdquo; or a piece of another one of your blood vessels to fix the aorta.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992643\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Women with aortic coarctation who want to get pregnant should talk to their doctor about the risks. Most women who have been treated can have a baby safely. &nbsp;",
"     </p>",
"     <p>",
"      In some women who have not been treated for aortic coarctation, pregnancy can be dangerous and in rare cases, fatal. The most common problem is high blood pressure. If a women&rsquo;s blood pressure stays in a normal range during her pregnancy, she can be treated for the condition after she delivers. But if her blood pressure gets too high, she might need to deliver early or get treatment before giving birth.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992660\">",
"      <span class=\"h1\">",
"       What will my life be like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many people with aortic coarctation are able to live normal lives. But high blood pressure and aortic coarctation can return after treatment. So you will need to see your doctor and get tested again at least every 5 years. Also, you should check with your doctor about what types of exercise you can do.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15992675\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?33/58/34722?source=see_link\">",
"       Patient information: High blood pressure in adults (The Basics)",
"      </a>",
"     </p>",
