"     5-120 mg (20): $18.86",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 12-hour",
"     </b>",
"     (KLS AllerClear D-12HR Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     5-120 mg (30): $18.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 24-hour",
"     </b>",
"     (Claritin-D 24 Hour Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10-240 mg (10): $12.80",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 24-hour",
"     </b>",
"     (Clear-Atadine D Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10-240 mg (10): $18.90",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 24-hour",
"     </b>",
"     (Wal-itin D 24 Hour Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10-240 mg (10): $10.99",
"    </p>",
"   </div>",
