"   <div class=\"block mop drugH1Div\" id=\"F188328\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Thyroid function test (serum thyroxine, thyrotropin concentrations), resin triiodothyronine uptake (rT",
"     <sub>",
"      3",
"     </sub>",
"     U), free thyroxine index (FTI), T",
"     <sub>",
"      4",
"     </sub>",
"     , TSH, heart rate, blood pressure, clinical signs of hypo- and hyperthyroidism; TSH is the most reliable guide for evaluating adequacy of thyroid replacement dosage. TSH may be elevated during the first few months of thyroid replacement despite patients being clinically euthyroid. In cases where T",
"     <sub>",
"      4",
"     </sub>",
"     remains low and TSH is within normal limits, an evaluation of &ldquo;free&rdquo; (unbound) T",
"     <sub>",
"      4",
"     </sub>",
"     is needed to evaluate further increase in dosage",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Infants: Monitor closely for cardiac overload, arrhythmias, and aspiration from avid suckling",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Infants/children: Monitor closely for under/overtreatment. Undertreatment may decrease intellectual development and linear growth, and lead to poor school performance due to impaired concentration and slowed mentation. Overtreatment may adversely affect brain maturation, accelerate bone age (leading to premature closure of the epiphyses and reduced adult height); craniosynostosis has been reported in infants. Treated children may experience a period of catch-up growth. Monitor TSH and total or free T",
"     <sub>",
"      4",
"     </sub>",
"     at 2 and 4 weeks after starting treatment; every 1-2 months for first year of life; every 2-3 months during years 1-3; every 3-12 months until growth completed. Perform routine clinical examinations at regular intervals (to assess mental and physical growth and development).",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Adults: Monitor TSH every 6-8 weeks until normalized; 8-12 weeks after dosage changes; every 6-12 months throughout therapy",
"    </p>",
"   </div>",
"   <div class=\"block rer drugH1Div\" id=\"F188331\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reference Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Pediatrics: Cord T",
"     <sub>",
"      4",
"     </sub>",
"     and values in the first few weeks are much higher, falling over the first months and years. &ge;10 years: ~5.8-11 mcg/dL (SI: 75-142 nmol/L). Borderline low: &le;4.5-5.7 mcg/dL (SI: 58-73 nmol/L); low: &le;4.4 mcg/dL (SI: 57 nmol/L); results &lt;2.5 mcg/dL (SI: &lt;32 nmol/L) are strong evidence for hypothyroidism.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Approximate adult normal range: 4-12 mcg/dL (SI: 51-154 nmol/L). Borderline high: 11.1-13 mcg/dL (SI: 143-167 nmol/L); high: &ge;13.1 mcg/dL (SI: 169 nmol/L). Normal range is increased in women on birth control pills (5.5-12 mcg/dL); normal range in pregnancy: ~5.5-16 mcg/dL (SI: ~71-206 nmol/L). TSH: 0.4-10 (for those &ge;80 years) mIU/L; T",
"     <sub>",
"      4",
"     </sub>",
"     : 4-12 mcg/dL (SI: 51-154 nmol/L); T",
"     <sub>",
"      3",
"     </sub>",
"     (RIA) (total T",
"     <sub>",
"      3",
"     </sub>",
"     ): 80-230 ng/dL (SI: 1.2-3.5 nmol/L); T",
"     <sub>",
"      4",
"     </sub>",
"     free (free T",
"     <sub>",
"      4",
"     </sub>",
"     ): 0.7-1.8 ng/dL (SI: 9-23 pmol/L).",
"    </p>",
"   </div>",
