"   <div class=\"block pha drugH1Div\" id=\"F188317\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Levothyroxine (T",
"     <sub>",
"      4",
"     </sub>",
"     ) is a synthetic form of thyroxine, an endogenous hormone secreted by the thyroid gland. T",
"     <sub>",
"      4",
"     </sub>",
"     is converted to its active metabolite, L-triiodothyronine (T",
"     <sub>",
"      3",
"     </sub>",
"     ). Thyroid hormones (T",
"     <sub>",
"      4",
"     </sub>",
"     and T",
"     <sub>",
"      3",
"     </sub>",
"     ) then bind to thyroid receptor proteins in the cell nucleus and exert metabolic effects through control of DNA transcription and protein synthesis; involved in normal metabolism, growth, and development; promotes gluconeogenesis, increases utilization and mobilization of glycogen stores, and stimulates protein synthesis, increases basal metabolic rate",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F188336\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Therapeutic: Oral: 3-5 days; I.V. 6-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Peak effect: I.V.: 24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Erratic (40% to 80% [per manufacturer]); may be decreased by age and specific foods and drugs",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: &gt;99% bound to plasma proteins including thyroxine-binding globulin, thyroxine-binding prealbumin, and albumin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic to triiodothyronine (T",
"     <sub>",
"      3",
"     </sub>",
"     ; active); ~80% thyroxine (T",
"     <sub>",
"      4",
"     </sub>",
"     ) deiodinated in kidney and periphery; glucuronidation/conjugation also occurs; undergoes enterohepatic recirculation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Oral tablets: 64% (nonfasting state) to 79% to 81% (fasting state)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: 2-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Euthyroid: 6-7 days; Hypothyroid: 9-10 days; Hyperthyroid: 3-4 days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (major route of elimination; decreases with age); feces (~20%)",
"    </p>",
"   </div>",
