" <div class=\"graphic2\" style=\"width: 1107px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Duodenal Peutz-Jeghers polyp",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 284px; height: 394px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power view of a duodenal Peutz-Jeghers polyp shows a tree-like proliferation of smooth muscle lined by normal small intestinal epithelium; the overlying epithelium is normal.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 517px\">",
"   <div class=\"ttl\">",
"    Normal small intestine",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 517px; height: 168px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low (left) and high (right) power views of the normal villous architecture of the small intestine. The high power view shows the enterocytes and interspersed goblet cells (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1108px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Colonic Peutz-Jeghers polyp",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 397px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power view of a colonic Peutz-Jeghers polyp shows a tree-like proliferation of smooth muscle lined by normal colonic cell types.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Normal colon",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 518px; height: 172px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low (left) and high (right) power views of a biopsy of a normal colon. Low power reveals straight crypts and mild lamina propria mononuclear cell infiltration. High power shows the surface enterocytes with interspersed goblet cells (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD",
"    </div>",
