var title_f40_43_41659="Proposed criteria for PV";
var content_f40_43_41659=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F77810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F77810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed revised WHO criteria for polycythemia vera",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Proposed criteria for PV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hemoglobin &gt;18.5 g/dL in men, 16.5 g/dL in women or other evidence of increased red cell volume*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Presence of JAK2 617V&gt;F or other functionally similar mutation such as JAK2 exon 12 mutation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bone marrow biopsy showing hypercellularity for age with trilineage growth (panmyelosis) with prominent erythroid, granulocytic, and megakaryocytic proliferation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum erythropoietin level below the reference range for normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Endogenous erythroid colony formation in vitro",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Diagnosis requires the presence of both major criteria and 1 minor criterion or the presence of the first major criterion together with 2 minor criteria.",
"    <div class=\"footnotes\">",
"     * Hemoglobin or hematocrit greater than 99th percentile of method-specific reference range for age, sex, altitude of residence or hemoglobin greater than 17 g/dL in men, 15 g/dL in women if associated with a documented and sustained increase of at least 2 g/dL from an individual's baseline value that can not be attributed to correction of iron deficiency, or elevated red cell mass greater than 25 percent above mean normal predicted value.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Tefferi, Ayalew, Thiele, Juergen, Orazi, Attilio, et al. Proposals and rationale for revision of the World Health Organization diagnostic criteria for polycythemia vera, essential thrombocythemia, and primary myelofibrosis: recommendations from an ad hoc international expert panel. Blood 2007; 110:1092. Copyright &copy;2007 American Society of Hematology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
